import React from 'react';
import styled from 'styled-components';

const FilterDiv = styled.div`
  background-color: red;
`;

function Filters() {
  return (
    <FilterDiv>
      <div className="filter-item">
        <div className="fiters-item__name"></div>
      </div>
    </FilterDiv>
  );
}

export default Filters;
